import React, { Component } from 'react';
import {Footer} from '../components/footer.js';

export class Markets extends Component {
    state = {  }

    styles = {
        header: {
            color: 'red',
            fontSize: 35
        },
        subheader: {
            color: 'red',
            fontSize: 25
        },
        bold: {
            fontWeight: 'bold'
        },
        blue: {
            color: '#1cb7e6',
            fontSize: 50
        }
    }

    render() { 
        return ( 
            <React.Fragment>
            <div class="container border border-grey">
                <h1 class="heading mt-5 ml-4" style={this.styles.header}>ADVANCED GEOPHYSICAL TECHNOLOGY</h1>

            </div>
            <Footer/>
            </React.Fragment>
        );
    }
}
